/*==================================================
StudentView.js

The Views component is responsible for rendering web page with data provided by the corresponding Container component.
It constructs a React component to display the single student view page.
================================================== */
// StudentView.js
import React from 'react';

const StudentView = ({ student, campus }) => {
  return (
    <div>
      <h1>{`${student.firstname} ${student.lastname}`}</h1>
      <p>
        <strong>Email:</strong> {student.email}
      </p>
      <p>
        <strong>GPA:</strong> {student.gpa || 'N/A'}
      </p>
      <p>
        <strong>Campus:</strong> {campus ? campus.name : 'Student not enrolled in any campus'}
      </p>
      <img src={student.imageUrl || 'https://via.placeholder.com/150'} alt="Student" />
    </div>
  );
};

export default StudentView;
